import React from 'react';
import {ResponsiveContainer, AreaChart, Area, XAxis, YAxis} from "recharts";

const data =[
  {
    name: 'Java',
    student: 12,
    fees: 10
  },
  {
    name: 'JavaScript',
    student: 20,
    fees: 100
  },
  {
    name: 'HTML',
    student: 21,
    fees: 10
  },
  {
    name: 'CSS',
    student: 11,
    fees: 21
  },
]


const MainAreaCharts = () => {
  return <div>
      <ResponsiveContainer width="100%" aspect={3}>
      <AreaChart width={30} height={250} data={data}>
      <XAxis dataKey="name"/>
       <Area dataKey="student"/>
      </AreaChart>

      </ResponsiveContainer>
  </div>;
};

export default MainAreaCharts;
